  constructor(props) {
    super(props);
    this.state = {
      isLoggedIn: false,
    };
  }
  // Met
  handleSignIn = () => {
    this.setState({ isLoggedIn: true });
  };

  render() {
    return (
      <div>
        <MethodsAsPropsChild isLoggedIn={this.state.isLoggedIn} />
      </div>
    );
  }
}

export default MethodsAsPropsParent;
